import React, {useState} from 'react';
import * as cal from './Heading.jsx';
import contact from './contacts.js'
import './index.css'

function App() {
    return contact.map( contact => 
      <cal.Cardz 
      key = {contact.id}
      id = {contact.id}
      name = {contact.name}
      tel = {contact.tel}
      email = {contact.email}
      />)
}
ReactDOM.render(
  <div>
   <cal.default /> 
  </div>,
  document.getElementById('roots')
);
export default App;
